  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort between
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment, the University of Hawaii, IMSG and Analytical
  Laboratories of Hawaii, LLC. The goal of the work was to incorporate previously
  developed mapping methods to produce coral reef habitat maps for The Republic of
  Palau. GPS field observations were used to establish the thematic accuracy of this
  thematic product. 623 benthic habitat characterizations were completed in UTM Zone
  53N for this work.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
